String> headers(){
    ImmutableListMultimap.Builder<String, String> builder = ImmutableListMultimap.builder();

    for (Header header : httpResponse.getHeaders()) {
      builder.put(header.getName(), header.getValue());
    }

    return builder.build();
  }

